import logo from './logo.svg';
import { useEffect,useState } from 'react';
import './App.css';
import axios from "axios";

function App() {
  const [qrCode,setQRCode] = useState(null);
  useEffect(()=>{
    axios.get("/barcodes/zxing").then(res => {
      setQRCode(res.data);
     });
  })
  return (
    <div className="App">
     <img src={require('file:///C:/QRCode/QRCode.png')} alt="hey"></img>
    </div>
  );
}

export default App;
